import ProductDetail from "./ProductDetail";

abstract class Item {
  id: number;
  title: string;
  price: number;
  pictureUrl: string;

  constructor(id: number, title: string, price: number, pictureUrl: string) {
    this.id = id;
    this.title = title;
    this.price = price;
    this.pictureUrl = pictureUrl;
  }

}

export default Item;
